import 'bootstrap/dist/css/bootstrap.min.css'
import { useState , useEffect } from 'react';
import axios from 'axios';
// 'https://api.openweathermap.org/data/3.0/onecall?lat=33.44&lon=-94.04&exclude=hourly,daily&appid=825162764da3a5b116301ebe099a54ee'

function Extras(){
    const [weather, setWeather] = useState({});
    useEffect(() => {
      const fetchData = async () => {
        const response = await fetch('https://api.openweathermap.org/data/3.0/onecall?lat=33.44&lon=-94.04&exclude=hourly,daily&appid=825162764da3a5b116301ebe099a54ee');
        const newData = await response.json();
        setWeather(newData);
      };

      fetchData();
    }, []);

